let rec clone x n =  if n <= 0 then [] else x :: clone x (n - 1)

let _ = clone 3 5;;
let _ = clone "foo" 2;; 
let _ = clone clone (-3);;


let padZero l1 l2 = (clone 0 (List.length l2 - List.length l1) @ l1, clone 0 (List.length l1 - List.length l2) @ l2)

let _ = padZero [9;9] [1;0;0;2]
let _ = padZero [1;0;0;2] [9;9] 

let rec removeZero l = match l with
  | [] -> []
  | h::t -> if h = 0 then removeZero t else h::t;;

let _ = removeZero [0;0;0;1;0;0;2]
let _ = removeZero [9;9]
let _ = removeZero [0;0;0;0]

let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = 
      let (num1, num2) = x in 
      let (carry, sum) = a in
        ((num1 + num2 + carry) / 10,(num1 + num2 + carry) mod 10::sum) in
    let base = (0, []) in
    let args = List.rev (List.combine l1 l2) in
    let (c, res) = List.fold_left f base args in
      c::res
  in 
    removeZero (add (padZero l1 l2));;

let _ = bigAdd [9;9] [1;0;0;2];;
let _ = bigAdd [9;9;9;9] [9;9;9];; 




let rec mulByDigit i l = if i <= 0 then [] else bigAdd l (mulByDigit (i - 1) l)


let _ = mulByDigit 9 [9;9;9;9]

